;; **
;;; #### Until-distinct
;;; 
;;; The above _until_ operator essentially performs a beadth-first search for a graph that satisfies the given constraint (while recursively applying the given sequence of operations).
;;; 
;;; The _until-distinct_ operator is a variation that only explores graph states that have not been seen before (again based on the notion of bisuimulation).
;;; 
;;; The _until-distinct_ macro uses the symbol `->*?#` and has otherwise the same form as the until operator:
;; **

;; @@
(-> (newgrape)
    (->n* 5 hello)
    (->*?# if-hello-then-to-world! world) view)
