;; <=

;; **
;;; ## Parallel rule application
;;; 
;;; As indicated earlier (part 1 of this tutorial), there are in general many possible applications for a graph transformation rule. The applications are said to be _parallel independent_ if all the graph elements matched in their left hand side are preserved (see [here](https://link.springer.com/chapter/10.1007/978-3-319-75396-6_4) for a formalization).
;;; 
;;; _GrapeVine_ provides the functionality to apply rules "parallel" mode. This is done by adding a `*` to the call of the rule. We demonstrate this functionality with the example of generating Sierpinski triangles, which was used as a case study for comparing Graph Transformation Tools at the [AGTIVE 2007 tool contest](https://www.cs.york.ac.uk/plasma/publications/pdf/PlumpEtAlAGTIVE.07.pdf).
;;; 
;;; We represent triangles with a `Triangle` node that has three corners (`top`, `left` and `right`). The following rule creates a first triangle:
;; **

;; @@
(rule setup []
      (create (node c1:Corner)
              (node c2:Corner)
              (node c3:Corner)
              (node t:Triangle)

              (edge :left t c1)
              (edge :right t c2)
              (edge :top t c3)))
