;; <=

;; **
;;; A Sierpinski triangle is a fractal structure. An abitrarily close approximation of a Sierpinski triangle can be calculated by recursively transforming each regular triangle (a triangle with a single top corner) into a structure of three regular triangles by creating corner points in the middle of each of the three edges. The image below illustrates this basic transformation step: 
;;; ![](https://raw.githubusercontent.com/jenshweber/grape/parallel-scalable/help/sierpinski1.png)
;; **

;; **
;;; The above image shows that in addition to transforming a regular triangle into three (smaller) regular triangles, the transformation yields an "upside-down" triangle in the middle. This triangle will not be transformed further.
;;; 
;;; Approximations for Sierpinski triangles must be computed in subsequent _generations_, i.e., the current generation must only  transform the (regular) triangles created in the previous generation, but not any newly created triangles. 
;;; 
;;; The Sierpinski triangle case study is thus a good example to demonstrate parallel rule applications. If we apply  transformations sequentially, we need to ensure thhat newly generated triangles are not transformed in the current generation step. This can be done in different ways. For example, we could choose a graph representation that marks traingles as _new_ or _old_ or records their generation number, while defining transformation rules that select only old triangles for transformation.
;;; 
;;; However, using parallel rule applications, we can simply apply the basic transformation step in parallel to all regular triangles of a given generation graph. The result will be a graph where all regular triangles in the previous graph have been transformed. 
;;; 
;;; > Note: The parallelization of a set of rule applications is possible if these rule applications are _parallel independent_, i.e., if all graph elements (node or edge) matched in the left-hand side of any rule are preserved by all rule applications in the set. 
;;; 
;;; The `step` rule below specifies the basic transformation step described above for our graph model:
;;; 
;; **

;; @@
(rule step []
      (read (node c1:Corner)
            (node c2:Corner)
            (node c3:Corner)
            (node t1:Triangle)
            (edge le:left t1 c1)
            (edge re:right t1 c2)
            (edge :top t1 c3))
      (delete le re)
      (create (node tl:Triangle)
              (node tr:Triangle)
              (node l:Corner)
              (node r:Corner)
              (node b:Corner)
              ; rewire matched triangle
              (edge :left t1 l)
              (edge :right t1 r)
              ; wire new left triangle
              (edge :top tl l)
              (edge :left tl c1)
              (edge :right tl b)
              ; wire new right triangle
              (edge :top tr r)
              (edge :left tr b)
              (edge :right tr c2)))
;; @@
