;; <=

;; **
;;; A parallel rule application in _GrapeVine_ is invoked by adding an asterisk (`*`) to the name of the rule invocation function call. For example, the statement below computes generation 1 of a Sierpinski triangle (approximation) by executing rule `step` in parallel mode. 
;;; 
;;; Of course, since there is only a single triangle to be transformed, the result is identical to the regular (sequential) application of rule `step`.
;; **

;; @@
(def gen1 (-> (newgrape) setup step*))
(view gen1)
