;; **
;;; The difference between parallel and sequential rule application becomes more apparent when computing the second generation of a Sierpinski triangle. There are three triangles to be transformed in Generation 1. Hence, calling `step` in sequential mode will return three possible graphs:
;; **

;; @@
(view (step gen1))
