;; **
;;; The `step` rule below has been modified to transform only those triangles of a given generation number (provided as a parameter).
;; **

;; @@
(rule step [g]
      (read (node c1:Corner)
            (node c2:Corner)
            (node c3:Corner)
            (node t1:Triangle {:gen "&g"})
            (edge le:left t1 c1)
            (edge re:right t1 c2)
            (edge :top t1 c3))
      (delete t1)
      (create (node tl:Triangle {:gen "&g+1"})
              (node tr:Triangle {:gen "&g+1"})
              (node tt:Triangle {:gen "&g+1"})
              (node l:Corner)
              (node r:Corner)
              (node b:Corner)
              ; wire new top triangle
              (edge :left tt l)
              (edge :right tt r)
              (edge :top tt c3)
              ; wire new left triangle
              (edge :top tl l)
              (edge :left tl c1)
              (edge :right tl b)
              ; wire new right triangle
              (edge :top tr r)
              (edge :left tr b)
              (edge :right tr c2)))
