;; **
;;; We can now use our modified rules to execute the generation of Sierpinski triangle approximations in "_batches_". For example, if `g` references a graph that representes the 9th generation of a Sierpinski triangle, we can compute the 10th generation by executing the following statement `(->* g (step*<n 1000 8))`.
;;; 
;;; The above statement uses the _as-long-as-possible (alap)_ loop to execute the step rule in parallel with a limit to 1000 matches and on triangles of generation 9.
;;; 
;;; The code below demonstrates that this approach for several generations. 
;;; 
;; **

;; @@
(debug! false)
(deleteall)
(def limit 4000)
(def g0 (setup (newgrape)))
(println "Gen 1") (time (->* g0 (step*<n limit 0))) (def g1 _)
(println "Gen 2") (time (->* g1 (step*<n limit 1))) (def g2 _)
(println "Gen 3") (time (->* g2 (step*<n limit 2))) (def g3 _)
(println "Gen 4") (time (->* g3 (step*<n limit 3))) (def g4 _)
(println "Gen 5") (time (->* g4 (step*<n limit 4))) (def g5 _)
(println "Gen 6") (time (->* g5 (step*<n limit 5))) (def g6 _)
(println "Gen 7") (time (->* g6 (step*<n limit 6))) (def g7 _)
(println "Gen 8") (time (->* g7 (step*<n limit 7))) (def g8 _)
(println "Gen 9") (time (->* g8 (step*<n limit 8))) (def g9 _)
;(println "Gen 10") (time (->* g9 (step*<n limit 9))) (def g10 _)
